      "'Tryst with Reality' is a memoir of an unplanned backpacking trip to the Himalayas that the author, Vishal Bhavsar, undertook with his college friend Sumant Kachru during the summer of 2017. In a matter of 15 days, a normal trip to Himalayas became a 'journey of a lifetime' for both of them. Even though they went on this trip with absolutely no purpose or expectation, they were lucky to experience some of the most beautiful moments of their lives. During their journey, they cried and they laughed, they enjoyed while they struggled, they surrendered even though they were vulnerable, they believed while they questioned, and they learned as they realised. However, according to Vishal the most important thing they did during those 15 days was - they allowed. They allowed things to just happen to them by keeping their hearts and minds open to recognize, understand and appreciate the many ways in which the universe was conspiring for them. 'Tryst with Reality' can be about friendship, adventure, spirituality, travel, pantheism or self-realisation depending upon which aspect establishes a connection with Readers as they read through. Vishal hopes that by the Time Readers finishes reading the book, it inspires them to start their own inner journey.",
